import React, { Component } from "react";

class Counter extends Component {
  state = {
    count: 1
  };
  render() {
    return (
      <React.Fragment>
        <h1>{this.state.count}</h1>
        <button>Increment</button>
      </React.Fragment>
    );
  }
}

export default Counter;
